import * as actionTypes from "../types";
import { tokenConfig } from "../auth";
export const getAssignmentListStart = () => {
  return {
    type: actionTypes.GETASSIGMENTLISTSTART,
  };
};

export const getAssignmentListSuccess = (assignments) => {
  return {
    type: actionTypes.GETASSIGMENTLISTSUCCESS,
    assignments,
  };
};

export const getAssignmentListFail = (error) => {
  return {
    type: actionTypes.GETASSIGMENTLISTFAIL,
    error: error,
  };
};

export const getAssignement = () => (dispatch, getState) => {
  return (dispatch) => {
    dispatch(getAssignmentListStart());
    axios
      .get("http://127.0.0.1:8000/api/assigments/", tokenConfig(getState))
      .then((res) => {
        const assigments = res.data;
        console.log(res.data);
        dispatch(getAssignmentListSuccess(assigments));
      })
      .catch((err) => {
        dispatch(getAssignmentListFail());
      });
  };
};
